       function onCountryChange(divId, element) {
        document.getElementById('city').style.display = element.value == 0 ? 'none' : 'block';
       var selectedCountry = document.getElementById("selectCountry").value;
       document.getElementById('selectCity').options.length = 0;
       var select = document.getElementById("selectCity");
       var cities = data.filter((city) =>{
        return city.COUNTRY == selectedCountry.toString();
     });
     var cityList = cities.map((cl) =>{
        return cl.CITY; 
     });
     // generate option for city dropdown 
    for(var i = 0; i < cityList.length; i++) {
    var opt = cityList[i];
    var el = document.createElement("option");
    el.textContent = opt;
    el.value = opt;
    select.appendChild(el);
}
 
}
JFCustomWidget.subscribe("ready", function(){
                var label = JFCustomWidget.getWidgetSetting('QuestionLabel');
                document.getElementById('allCountryCityLable').innerHTML = label;
                //subscribe to form submit event
                JFCustomWidget.subscribe("submit", function(){
                    var submitData = { 
                    "county" : document.getElementById('selectCountry').value,
                    "city" : document.getElementById('selectCity').value }
                    var msg = {
                        //you should valid attribute to data for JotForm
                        //to be able to use youw widget as required
                         
                        value: submitData
                    }
                    // send value to JotForm
                    JFCustomWidget.sendSubmit(msg);
                });
            });
